<p>–Ü —Ü–µ –≤–∏–∫–ª—é—á–∞–ª–æ –±—É–¥—å-—è–∫—É —é—Ä–∏¬¨ –¥–∏—á–Ω—É –º–æ–∂–ª–∏–≤—ñ—Å—Ç—å –Ω–∞–¥–∞–Ω–Ω—è –π–æ–≥–æ –∞—Ç–æ–≤—Ü—è–º –û—Å–æ–±–ª–∏–≤–æ –∑–Ω—É—â–∞–ª—å–Ω–∏–º–∏ –≤–∏–¥–∞—é—Ç—å—Å—è –º–∞—Ö—ñ–Ω–∞¬¨ —Ü—ñ—ó –∑ —É–∂–µ –≤–∏–¥—ñ–ª–µ–Ω–∏–º–∏ –¥—ñ–ª—è–Ω–∫–∞–º–∏. –°–∫–∞–∂—ñ–º–æ, –≤–∏ –æ—Ç—Ä–∏–º–∞–ª–∏ —Ä—ñ—à–µ–Ω–Ω—è –º—ñ—Å—å–∫–æ–≥–æ –æ—Ä–≥–∞–Ω—É —Å–∞–º–æ–≤—Ä—è¬¨ –¥—É–≤–∞–Ω–Ω—è –ø—Ä–æ –≤—ñ–¥–≤–µ–¥–µ–Ω–Ω—è –¥–µ—Å—è—Ç–∏ —Å–æ—Ç–æ–∫ –≤–∞–º –ø—ñ–¥ –∑–∞–±—É–¥–æ–≤—É. –ü—Ä–æ–π—à–ª–∏ —è–∫ –∞—Ç–æ–≤–µ—Ü—å –ø–æ –≤—Å—ñ—Ö —ñ–Ω—Å—Ç–∞–Ω¬¨ —Ü—ñ—è—Ö —ñ –Ω–∞–≤—ñ—Ç—å –æ–ø–ª–∞—Ç–∏–ª–∏ –Ω–∞–ø–µ—Ä–µ–¥ –Ω–µ–¥–µ—à–µ–≤—ñ –ø–æ¬¨ —Å–ª—É–≥–∏ —Ñ—ñ—Ä–º–∏, –∫–æ—Ç—Ä–∞ –≤–∏–≥–æ—Ç–æ–≤–∏—Ç—å –≤–∞–º –ø—Ä–æ–µ–∫—Ç —ñ–∑ –∑–µ–º–ª–µ—É—Å—Ç—Ä–æ—é. –Ü —Ç—É—Ç –∑–µ–º–ª–µ–≤–ø–æ—Ä—è–¥–Ω–∏–∫ –≤–∏—è–≤¬¨ –ª—è—î, —â–æ –Ω–∞—Å–ø—Ä–∞–≤–¥—ñ –∑–∞–∑–Ω–∞—á–µ–Ω–∞ –¥—ñ–ª—è–Ω–∫–∞ –Ω–∞ —Å–æ—Ç- –∫—É-–¥—Ä—É–≥—É –º–µ–Ω—à–∞ –∑–∞ –≤–∏–∑–Ω–∞—á–µ–Ω—ñ —Ä–æ–∑–º—ñ—Ä–∏ –≤ –¥–æ–∫—É¬¨ –º–µ–Ω—Ç–∞—Ö.</p>
<p>–ù–µ —Å—É–º–Ω—ñ–≤–∞–π—Ç–µ—Å—è: –ø—ñ—Å–ª—è –ø–µ—Ä—à–æ—ó –∂ –≤–∞¬¨ —à–æ—ó —Å–∫–∞—Ä–≥–∏ –ø–æ—Ä—É—á –∑'—è–≤–∏—Ç—å—Å—è –¥–æ–±—Ä–æ–∑–∏—á–ª–∏–≤–µ—Ü—å, —è–∫–∏–π —Å–ø—ñ–≤—á—É—Ç–ª–∏–≤–æ –ø–æ—è—Å–Ω–∏—Ç—å, —â–æ –≤ —Ä–∞–∑—ñ –≤–∞—à–æ—ó –≤—ñ–¥–º–æ–≤–∏ –≤—ñ–¥ –Ω–∞–¥—ñ–ª—É –≤–∞–º —à—É–∫–∞—Ç–∏–º—É—Ç—å –Ω–æ–≤–∏–π —ñ—â–µ –∫—ñ–ª—å–∫–∞ —Ä–æ–∫—ñ–≤, –∞ –ø—Ä–æ—Ü–µ–¥—É—Ä—É –π–æ–≥–æ –æ—Ç—Ä–∏–º–∞–Ω–Ω—è –¥–æ¬¨ –≤–µ–¥–µ—Ç—å—Å—è —Ä–æ–∑–ø–æ—á–∏–Ω–∞—Ç–∏ –∑–∞–Ω–æ–≤–æ. –ö–æ–∂–µ–Ω –¥—Ä—É–≥–∏–π, –º–∞–±—É—Ç—å, –ø–æ–≥–æ–¥–∏—Ç—å—Å—è –Ω–∞ ¬´—Å–∏–Ω–∏—Ü—é –≤ —Ä—É–∫–∞—Ö¬ª. –Ü—Å–Ω—É—î —Å–≤–æ—è —à–∞—Ö—Ä–∞–π—Å—å–∫–∞ —Å—Ö–µ–º–∞ —ñ –≤ –±–∞–≥–∞—Ç—å–æ—Ö –º—ñ—Å¬¨ —Ç–∞—Ö –æ–±–ª–∞—Å–Ω–æ–≥–æ –∑–Ω–∞—á–µ–Ω–Ω—è —Ç–∞ —Å–µ–ª–∞—Ö. –ü—Ä–∞–∫—Ç–∏—á–Ω–æ –≤ —É—Å—ñ—Ö —Å–µ–ª–∞—Ö –Ω–µ–º–∞—î –≥–µ–Ω–µ—Ä–∞–ª—å–Ω–æ–≥–æ –ø–ª–∞–Ω—É, —â–æ —î —á—É¬¨ –¥–æ–≤–∏–º –ø—Ä–∏–∫—Ä–∏—Ç—Ç—è–º –¥–ª—è –ø–µ—Ä–µ–Ω–µ—Å–µ–Ω–Ω—è —Ä–æ–∑–≥–ª—è–¥—É –∑–∞¬¨ —è–≤ –≤–µ—Ç–µ—Ä–∞–Ω—ñ–≤ –ê–¢–û –Ω–∞ –Ω–µ–≤–∏–∑–Ω–∞—á–µ–Ω–∏–π —Ç–µ—Ä–º—ñ–Ω —ñ –¥–µ—Ä–µ- –±–∞–Ω—É –∑–µ–º–ª—ñ –º—ñ—Å—Ü–µ–≤–æ—é ¬´–µ–ª—ñ—Ç–æ—é¬ª.</p>
<p>–ß–∞—Å—Ç–æ —á–∏–Ω–æ–≤–Ω–∏–∫–∏ –∫–æ—Ä–∏—Å—Ç—É—é—Ç—å—Å—è —é—Ä–∏–¥–∏—á–Ω–æ—é –Ω–µ–æ–±—ñ–∑–Ω–∞–Ω—ñ—Å—Ç—é –≤–µ—Ç–µ—Ä–∞¬¨ –Ω—ñ–≤ —ñ —Ç–∞–∫ —É—Å–∫–ª–∞–¥–Ω—é—é—Ç—å –ø–∏—Ç–∞–Ω–Ω—è, —â–æ –±–∞–≥–∞—Ç–æ —Ö—Ç–æ –≤–∂–µ –π –Ω–µ –≤—ñ—Ä–∏—Ç—å, —â–æ –∫–æ–ª–∏-–Ω–µ–±—É–¥—å –∑–º–æ–∂–µ –æ—Ç—Ä–∏–º–∞—Ç–∏ –¥—ñ¬¨ –ª—è–Ω–∫—É –∑–µ–º–ª—ñ. –¢–æ —á–∏ –º–æ–∂–Ω–∞ —â–æ—Å—å —É–¥—ñ—è—Ç–∏ —ñ–∑ —Ü–∏–º —É—Å—ñ–º?</p><strong><a id='w4'></a><h2>–î–í–ê–î–¶–Ø–¢–¨ –ü–ï–†–®–Ü –°–£–ú–¶–û–í–°–¨–ö–Ü –ß–ò–¢–ê–ù–ù–Ø</h2></strong><p>–í–æ–Ω–∏ –∂ –±–æ –∑–Ω–∞—é—Ç—å —É –∑–∞–∫–æ–Ω–æ–¥–∞–≤—Å—Ç–≤—ñ –∫–æ–∂–Ω—É —à–ø–∞—Ä–∏–Ω—É, —á–µ—Ä–µ–∑ —è–∫—É –≤—Å–µ-–æ–¥–Ω–æ –∑–¥—ñ–π—Å–Ω—é–≤–∞—Ç–∏–º—É—Ç—å —Å–≤–æ—ó –æ–±–æ—Ä—É–¥–∫–∏, ‚Äî —Ä–æ–∑–º—ñ—Ä–∫–æ–≤—É—î –°–≤—ñ—Ç–ª–∞–Ω–∞ –®–µ–ø–æ¬¨ –≤–∞–ª–æ–≤–∞. –£–ø–µ–≤–Ω–µ–Ω–∞, —â–æ –æ—à—É–∫–∞–Ω—ñ –≤ –£–∂–≥–æ—Ä–æ–¥—ñ —Ö–ª–æ–ø—Ü—ñ –Ω–∞¬¨ –≤—ñ—Ç—å –Ω–µ –ø–æ—Ü—ñ–∫–∞–≤–∏–ª–∏—Å—è –≤–∞—Ä—Ç—ñ—Å—Ç—é –∑–µ–º–µ–ª—å —É —Ç–æ–º—É —Ä–∞–π¬¨ –æ–Ω—ñ. –ê–ª–µ —Ü–µ –∂ –ø—Ä–æ—Å—Ç–æ, —Ç—Ä–µ–±–∞ –ª–∏—à–µ –∑–≤–µ—Ä–Ω—É—Ç–∏—Å—è –¥–æ –æ–±—ñ–∑–Ω–∞–Ω–∏—Ö –ª—é–¥–µ–π —ñ –∑–Ω–∞–π–æ–º–∏—Ö —é—Ä–∏—Å—Ç—ñ–≤. –û–¥–Ω–∞–∫ —Ä–æ–¥–∑–∏–Ω–∫–∞ —Å–∏—Ç—É–∞—Ü—ñ—ó –Ω–µ –≤ —Ü—å–æ–º—É. –í–µ—Ç–µ—Ä–∞–Ω–∞–º —Ä–∞–¥—è—Ç—å —ñ –≤ –º–∏—Ä–Ω–æ–º—É –∂–∏—Ç—Ç—ñ —Ç—Ä–∏–º–∞—Ç–∏—Å—è –∫—É–ø–∏. –í–∏–ø–∞–¥¬¨ –∫–∏, –∫–æ–ª–∏ –≤–æ–Ω–∏ —É—Ç–≤–æ—Ä–∏–ª–∏, –Ω–∞–ø—Ä–∏–∫–ª–∞–¥, –∑–µ–º–µ–ª—å–Ω–∏–π –∫–æ¬¨ –æ–ø–µ—Ä–∞—Ç–∏–≤ —ñ –≥–æ—Å–ø–æ–¥–∞—Ä—é—é—Ç—å –Ω–∞ —Å–≤–æ—ó–π –∑–µ–º–ª—ñ —Å–∞–º–æ—Å—Ç—ñ–π¬¨ –Ω–æ, –º–æ–∂–Ω–∞ –ø–æ—Ä–∞—Ö—É–≤–∞—Ç–∏ –Ω–∞ –ø–∞–ª—å—Ü—è—Ö.</p>
<p>–ù–∞–π–∫—Ä–∞—â–∏–π —Å—Ç–∞–Ω —Å–ø—Ä–∞–≤ —ñ–∑ –≤–∏–¥—ñ–ª–µ–Ω–Ω—è–º —ñ –≤–∏–∫–æ—Ä–∏—Å—Ç–∞–Ω–Ω—è–º –¥—ñ–ª—è–Ω–æ–∫ –º–∏ –º–∞—î–º–æ —Ç–∞–º, –¥–µ –≤ –æ—Ä–≥–∞–Ω–∞—Ö –º—ñ—Å—Ü–µ–≤–æ–≥–æ —Å–∞–º–æ–≤—Ä—è–¥—É¬¨ –≤–∞–Ω–Ω—è —Ç–∞–∫ —á–∏ —ñ–Ω–∞–∫—à–µ –ø—Ä–∏—Å—É—Ç–Ω—ñ —Å–∞–º—ñ –∞—Ç–æ–≤—Ü—ñ. –ü—Ä–∏¬¨ –∫–ª–∞–¥ ‚Äî ¬´–ê—Å–æ—Ü—ñ–∞—Ü—ñ—è —É—á–∞—Å–Ω–∏–∫—ñ–≤ –ê–¢–û –ë—ñ–ª–æ—Ü–µ—Ä–∫—ñ–≤—â–∏- –Ω–∏¬ª, —è–∫–∞ –≤–≤–µ–ª–∞ –≤ –¥–µ–ø—É—Ç–∞—Ç—Å—å–∫–∏–π –∑–µ–º–µ–ª—å–Ω–∏–π –∫–æ–º—ñ—Ç–µ—Ç –Ω–∞ –¥–æ—Ä–∞–¥—á–∏—Ö –ø—Ä–∞–≤–∞—Ö —Å–≤–æ—ó—Ö —á–ª–µ–Ω—ñ–≤. –Ü –Ω–µ–æ–¥–º—ñ–Ω–Ω–æ —Ç—Ä–µ¬¨ –±–∞ –Ω–∞–π–º–∞—Ç–∏ —é—Ä–∏—Å—Ç—ñ–≤, —è–∫—ñ –≤ –∑–º–æ–∑—ñ –∫–æ–Ω—Ç—Ä–æ–ª—é–≤–∞—Ç–∏ —ñ–Ω¬¨ –≤–µ–Ω—Ç–∞—Ä–∏–∑–∞—Ü—ñ—é –∑–µ–º–µ–ª—å–Ω–∏—Ö –¥—ñ–ª—è–Ω–æ–∫ —Ç–∞ –ø—Ä–∞—Ü—é–≤–∞—Ç–∏ –Ω–∞–¥ —î–¥–∏–Ω–æ—é –∫–∞—Ä—Ç–æ—é –≤—ñ–ª—å–Ω–∏—Ö –∑–µ–º–µ–ª—å–Ω–∏—Ö –¥—ñ–ª—è–Ω–æ–∫. –í–∏ –∂ —É –≤—ñ–π—Å—å¬¨ –∫–æ–≤—ñ–π —Ñ–æ—Ä–º—ñ! –ê –º–µ–Ω—ñ —â–æ –∑ —Ç–æ–≥–æ, —â–æ –≤–∏ –æ–¥—Ä—É¬¨ –∂—É–≤–∞—Ç–∏—Å—å —ó–¥–µ—Ç–µ?</p>
